pragma solidity ^0.4.2;

import "./PlayerFactory.sol";

contract Marketplace is PlayerFactory {

  uint maximumPlayerAllowed;

  function Marketplace() public {
    maximumPlayerAllowed = 5;
  }

  event PlayerToSell(uint playerId, uint price);
  event PlayerSold(uint playerId);

  mapping (uint => uint) playerToPrice;

  function sellPlayer(uint _playerId, uint _price) external {
    require(_owns(msg.sender, _playerId));
    require(_price > 0);

    playerToPrice[_playerId] = _price;

    PlayerToSell(_playerId, _price);
  }

  function buyPlayer(uint _playerId) external payable {
    // Make sure that this player is being sold
    require(playerToPrice[_playerId] > 0);

    // Value need to be greater than price, for gas execution
    require(msg.value >= playerToPrice[_playerId]);

    // Make sure that buyer could add more player to his team
    require(ownerToPlayerCount[msg.sender] + 1 <= maximumPlayerAllowed);

    transferPlayer(playerToOwner[_playerId], msg.sender, _playerId);

    // Delete mapping after someone buy this player
    delete playerToPrice[_playerId];

    PlayerSold(_playerId);

  }
}
